<?phpnamespace Nemundo\App\SystemLog\Com\ListBox;use Nemundo\Admin\Com\ListBox\AdminListBox;use Nemundo\App\SystemLog\Data\LogType\LogTypeReader;class LogTypeListBox extends AdminListBox{    public function getContent()    {        $this->label = 'Log Type';        $reader = new LogTypeReader();        foreach ($reader->getData() as $logTypeRow) {            $this->addItem($logTypeRow->id, $logTypeRow->logType);        }        return parent::getContent();    }}